import { useReducer } from "react";
import CheckBox from "./CheckBox";

const Checkboxes = () => {
  return (
    <div>
      {checkboxes.map((checkbox, idx) => {
        return (
          <CheckBox
            id={idx}
            key={idx}
            content={checkbox}
            dispatchHandler={dispatch}
          ></CheckBox>
        );
      })}
    </div>
  );
};

export default Checkboxes;
